import {
  Routes,
  Route,
  useParam,
  useLocation,
  useNavigate,
} from "react-route-dom";
import { CSSTransition, TransitionGroup } from "react-transition-group";
import RouterList from "./router";

const RouterRender = ({ router, match }) => {
  let { location } = router;
  return (
    <TransitionGroup>
      <CSSTransition>
        <Routes>
          {RouterList.map((route, index) => {
            return (
              <Route
                key={index}
                path={route.path}
                element={<route.component {...route.props}></route.component>}
              ></Route>
            );
          })}
        </Routes>
      </CSSTransition>
    </TransitionGroup>
  );
};
